import React from 'react';
import {MainRoute} from './Routes/MainRoute'
import {BrowserRouter, Link} from 'react-router-dom'
import {Provider, connect} from 'unistore/preact'
import {store} from './store'

function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
        <div className="App">
        <MainRoute />
        </div>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
